import React from 'react';
import { View } from 'react-native';
import { FontAwesome5 } from '@expo/vector-icons';
import { Ionicons } from '@expo/vector-icons';
import { MaterialCommunityIcons } from '@expo/vector-icons';

import colors from '../../styles/colors';
import { styles } from '../../styles/styles';
import AppText from '../../components/text/AppText';
import AppMenu from '../../components/menu/AppMenu';

const MenusScreen = () => {

    const { bg_light, container, rounded } = styles;
    const { light } = colors;

    return (
        <View style={container}>

            <View style={[bg_light, rounded]}>
                <AppMenu title='Name' subtitle='Edit Personal Information' icon={<FontAwesome5 name="user" size={20} color={light} />} />
                <AppMenu title='My Store' subtitle='View rented slot details' icon={<FontAwesome5 name="store" size={20} color={light} />} />
            </View>

            <View style={[bg_light, rounded]}>
                <AppMenu title='Slot Locator' subtitle='Visual map and available slots' icon={<Ionicons name="location-outline" size={20} color={light} />} />
                <AppMenu title='Mode of Payment' subtitle='List of acceptable payment methods' icon={<Ionicons name="card" size={20} color={light} />} />
                <AppMenu title='Contacts' subtitle='Where to find us?' icon={<FontAwesome5 name="phone" size={20} color={light} />} />
                <AppMenu title='Logout' subtitle='Logout' icon={<MaterialCommunityIcons name="logout-variant" size={20} color={light} />} />
            </View>
        </View>
    );
}

export default MenusScreen;
